import React from 'react'

const Cell = ({cellState}) => {
    if (cellState === 0) {
        return <div className='gamecell'> 0</div>
    }
    if (cellState === 1) {
        return <div className='gamecell'> 1</div>
    }
    if (cellState === 2) {
        return <div className='gamecell'> 2</div>
    }
}

export default Cell;
